ied_gmt\": \"2025-06-13 13:17:32\"\n    },\n    \"sidebars_widgets[modern-art-gallery-footer-widget-1]\": {\n        \"value\": [\n            \"block-16\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-06-13 13:20:31\"\n    },\n    \"widget_block[10]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:heading {\\\"level\\\":3} -->\\n<h3 class=\\\"wp-block-heading\\\">Displate Metal Posters \\u2013 Wall Art That Gets You</h3>\\n<!-- /wp:heading -->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-06-13 13:20:31\"\n    },\n    \"widget_block[11]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:paragraph -->\\n<p>Displate is where stunning wall art meets everything you love. Dive into over 1.5 million metal poster designs and surround yourself with <a href=\\\"https://displate.com/browse-brands\\\">official artwork</a> from your favorite <a href=\\\"https://displate.com/posters?category=gaming\\\">video games</a>, <a href=\\\"https://displate.com/posters?category=movies\\\">movies</a>, <a href=\\\"https://displate.com/posters?category=anime\\\">anime</a>, <a href=\\\"https://displate.com/posters?category=tv-shows\\\">TV shows</a>, and more. They\'re all here, on uniquely designed and wall-safe art prints! Matching your space to your style with new wall art has never been easier. Metal posters from Displate are tool-free and <a href=\\\"https://displate.com/accessories\\\">magnet-mounted</a>, so you can hang your art prints in seconds. No nails, no holes, no sweat: just top-quality steel posters built to last for decades.</p>\\n<!-- /wp:paragraph -->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-06-13 13:20:31\"\n    },\n    \"widget_block[12]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:heading {\\\"level\\\":3} -->\\n<h3 class=\\\"wp-block-heading\\\">Modern Wall Art, Redefined</h3>\\n<!-- /wp:heading -->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-06-13 13:20:31\"\n    },\n    \"widget_block[13]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:paragraph -->\\n<p>Displates are posters made to impress: with a striking 3D-enhanced <a href=\\\"https://displate.com/search?q=textra\\\">Textra</a> finish, a smooth matte surface, or a sleek gloss look. They\'re unlike any art prints you\'ve seen before. This premium metal wall art looks unique and stays vibrant and timeless, so you can enjoy your favorite artwork for years to come. All metal posters come in gift-ready packaging. This way, Displates are your perfect gift for any pop culture fan, anime lover or art enthusiast in your life!</p>\\n<!-- /wp:paragraph -->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-06-13 13:20:31\"\n    },\n    \"widget_block[14]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:heading {\\\"level\\\":3} -->\\n<h3 class=\\\"wp-block-heading\\\">A Leading Online Art Marketplace</h3>\\n<!-- /wp:heading -->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-06-13 13:20:31\"\n    },\n    \"widget_block[15]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:paragraph -->\\n<p>With over 40,000 artists on board, Displate is also the world\'s leading global marketplace for metal posters. Discover captivating new wall art for sale straight from emerging illustrators, painters, and visual designers worldwide.<br>Each creator brings their unique style and perspective. From <a href=\\\"https://displate.com/search?q=contemporary\\\">contemporary posters</a>, <a href=\\\"https://displate.com/search?q=abstract\\\">abstract art prints</a> or iconic <a href=\\\"https://displate.com/search?q=pop-culture\\\">pop culture</a> pieces, Displate connects you with a world of creativity \\u2013 all in one place.<br>Join over 5 million satisfied customers who trust Displate for their wall decor needs. <a href=\\\"https://displate.com/browse-collections\\\">Explore our stunning collection</a> of officially licensed metal posters and unique art prints. Your walls will thank you!</p>\\n<!-- /wp:paragraph -->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-06-13 13:20:31\"\n    },\n    \"widget_block[16]\": {\n        \"value\": {\n            \"raw_instance\": {\n                \"content\": \"<!-- wp:calendar /-->\"\n            }\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2025-06-13 13:20:31\"\n    }\n}', '', '', 'auto-draft', 'closed', 'closed', '', '37389e88-605c-4f84-a108-169213849a34', '', '', '2025-06-13 13:20:31', '2025-06-13 13:20:31', '', 0, 'http://localhost/wordpress_displate/?p=126', 0, 'customize_changeset', '', 0),
