(171, 1, '2025-06-13 14:46:28', '2025-06-13 14:46:28', 'This image showcases the main characters from the popular anime and manga series Demon Slayer: Kimetsu no Yaiba. From left to right, we see Inosuke Hashibira, Zenitsu Agatsuma, Nezuko Kamado, and Tanjiro Kamado. Inosuke is depicted in his boar mask, displaying his fierce warrior nature. Zenitsu is holding a katana, his eyes wide with fear. Nezuko, in her signature pink and green checkered kimono, is poised for action, her bamboo muzzle signifying her demon nature.', 'Demon Slayer Cover Art', 'This image showcases the main characters from the popular anime and manga series Demon Slayer: Kimetsu no Yaiba.', 'publish', 'open', 'closed', '', 'demon-slayer-cover-art', '', '', '2025-06-13 14:46:28', '2025-06-13 14:46:28', '', 0, 'http://localhost/wordpress_displate/?post_type=product&#038;p=171', 0, 'product', '', 0),
