(180, 1, '2025-06-13 15:01:24', '2025-06-13 15:01:24', '<div class=\"HeroDescription_wrapper__2dQ00\">\r\n<div class=\"HeroDescription_descriptionWrapper__PvCn6\">\r\n<p class=\"HeroDescription_descriptionText__1T5Vb HeroDescription_whiteSpace__T8oXh HeroDescription_overflowY___Vwh1 HeroDescription_expanded__bEk3_\">Step into the enchanting realm of Middle-Earth with our captivating digital artwork, The Fellowship of the Ring, a treasured addition to The Lord of the Rings Movie Posters collection. This stunning piece offers a glimpse into Tolkien`s world as envisioned by Peter Jackson, transporting viewers to Gondor’s prestigious boundary marked by the mighty Argonath—Isildur and Anarion in stately repose. As soft light pierces through mystical haze above Anduin`s waters, your eye is drawn to the minute fellowship navigating their momentous voyage beneath these colossal monuments. Perfect for enthusiasts of warner bros’ epic trilogy, this fantasy movies poster invites you on an adventure with every gaze.</p>\r\n\r\n</div>\r\n</div>\r\n<div class=\"TrustpilotReviews_wrapper__oCEH3\">\r\n<div class=\"TrustpilotReviews_reviews__0d1Cj\" data-testid=\"hero-trustpilot-reviews-button\">\r\n<div class=\"TrustpilotReviewStars_wrapper__6_TmR TrustpilotReviews_trustpilotReviewStars__rThIW\"></div>\r\n</div>\r\n</div>', 'Lord of the Rings Cover Art', 'Step into the enchanting realm of Middle-Earth with our captivating digital artwork, The Fellowship of the Ring, a treasured addition to The Lord of the Rings Movie Posters collection.', 'publish', 'open', 'closed', '', 'lord-of-the-rings-cover-art', '', '', '2025-06-13 15:01:24', '2025-06-13 15:01:24', '', 0, 'http://localhost/wordpress_displate/?post_type=product&#038;p=180', 0, 'product', '', 0),
